import React from 'react';
import Card from '@material-ui/core/Card';
import CardActionArea from '@material-ui/core/CardActionArea';
import CardActions from '@material-ui/core/CardActions';
import CardContent from '@material-ui/core/CardContent';
import CardMedia from '@material-ui/core/CardMedia';
import Button from '@material-ui/core/Button';
import Typography from '@material-ui/core/Typography';
import { makeStyles,Theme , createStyles} from '@material-ui/core/styles';
import memberDetail from './memberDetail.json'
import Avatar from '@material-ui/core/Avatar';


export default class MediaCard extends React.Component {
    state = {
        memberDetail: memberDetail,
        classes: this.useStyles,
    
};
 useStyles = makeStyles((theme: Theme) =>

  createStyles({
  root: {
    maxWidth: 200,
    maxHeight:230,

  },
  avatar: {
    display: 'flex',
    '& > *': {
      margin: theme.spacing(4),
      marginBottom:theme.spacing(2),
    },
  },
  large: {
      width: theme.spacing(14),
      height: theme.spacing(14),
    },
    content: {
      marginTop: theme.spacing(0),
      
    },
  })
);

  render(){ 
      return (
        <div>
        <Card className={this.state.classes.root}>
            <div className={this.classes.avatar}>
            <Avatar alt="Remy Sharp" className={this.classes.large}  src="images/Kalash.jpg" />
            </div>
            <CardActionArea className={this.classes.content}>
                <CardContent className={this.classes.content} >
                <Typography gutterBottom variant="h5" component="h2">    
                </Typography>
                <Typography variant="body2" color="textSecondary" component="p">
                    Lizards are a widespread group of squamate 
                </Typography>
                </CardContent>
            </CardActionArea>
        </Card>
    </div>
  );
  }
  
}
